export const INDEX_OF_TX_DATA_36 = 36

class TransactionData {
  proofBlob: string
  txRaw: string
  txRoot: string
  optionalData?: string[]

  constructor(
    proofBlob: string,
    txRaw: string,
    txRoot: string,
    optionalData?: string[]
  ) {
    this.proofBlob = proofBlob
    this.txRaw = txRaw
    this.txRoot = txRoot
    this.optionalData = optionalData
  }
}

